{"post_stream":{"posts":[{"id":3145555,"name":"Jackson Elia","username":"Traptricker","avatar_template":"/user_avatar/www.chiefdelphi.com/traptricker/{size}/215403_2.png","created_at":"2023-02-14T23:17:00.995Z","cooked":"<p>Hello,</p>
<p>I’m having trouble with my swerve’s odometry. Its value keeps approaching zero, and from what I can tell, it’s because our <code>SwerveModulePosition getPosition()</code> method isn’t working right. The value for distance that it is returning also keeps approaching zero (When it’s driving, it has a value, maybe its speed? but when you stop it goes back to zero).</p>
<p>Here is the code for getting the swerve module position:</p>
<pre><code class="lang-auto">public SwerveModulePosition getPosition() {
    return new SwerveModulePosition(
      ModuleConstants.drivetoMetersPerSecond * driveMotor.getSelectedSensorVelocity(), 
      Rotation2d.fromDegrees(getCANCoderABS())
    );
  }
</code></pre>
<p>Code for ModuleConstants.drivetoMetersPerSecond</p>
<pre><code class="lang-auto">public static final double wheelDiameterMeters = Units.inchesToMeters(4); // 4 inches
    public static final double wheelCircumferenceMeters =
        wheelDiameterMeters * Math.PI; // C = D * pi
    public static final double drivetoMetersPerSecond =
        (10 * wheelCircumferenceMeters) / (driveGearRatio * driveFXEncoderCPR);
